import { useState } from "react"

function AddProdact(){
    const [Data1,setData]=useState("")
    const [Data2,setData2]=useState("")
 function Form(e){
    e.preventDefault ()
    axios.post(`http://localhost:9000/prodact`,{
        Data1,Data2
    })

 }
 
return(
<form onSubmit={Form}>
<div className="mb-3">
<label htmlFor="title" className="form-label">Title address</label>
<input type="text" className="form-control" id="title" placeholder="title"  onChange={(e)=>setData(e.target.value)} />
</div>
<div className="mb-3">
<label htmlFor="prodact price" className="form-label">price</label>
<input  type="password" className="form-control"   id="prodact price" placeholder="Price"   onChange={(e)=>setData2(e.target.value)}/>
</div>
<button   type="submit" className="btn btn-primary">Add Prodact</button>
</form>
    )
}
export default AddProdact
